
! =========================================
! Cula Sparse Types
! =========================================

module cula_sparse_type
    use, intrinsic :: iso_c_binding
    implicit none

    !
    ! Enumerated Types
    ! 

    ! culaSparseStatus
    enum, bind(C)
        enumerator culaSparseNoError
        enumerator culaSparseNonConvergence
        enumerator culaSparsePreconditionerError
        enumerator culaSparseArgumentError
        enumerator culaSparseDataFormatError
        enumerator culaSparseInsufficientMemory
        enumerator culaSparseFeatureNotImplemented
        enumerator culaSparseRuntimeError
        enumerator culaSparseAlignmentError
        enumerator culaSparseInteralError
        enumerator culaSparseHandleError
        enumerator culaSparsePlanError
        enumerator culaSparseUnspecifiedError
    end enum

    ! culaSparseFlag
    enum, bind(C)
        enumerator culaSparseConvergedToRelative
        enumerator culaSparseConvergedToAbsolute
        enumerator culaSparseDiverged
        enumerator culaSparseMaxIterationsReached
        enumerator culaSparseMaxTimeReached
        enumerator culaSparseStagnation
        enumerator culaSparseBreakdown
        enumerator culaSparseInterrupted
        enumerator culaSparseSolveNotExecuted
        enumerator culaSparseUnknownIterationError
    end enum

    ! culaSparseReordering
    enum, bind(C)
        enumerator culaSparseNoReordering
        enumerator culaSparseAmdReordering
        enumerator culaSparseSymamdReordering
    end enum

    ! culaSparseSparsityPattern
    enum, bind(C)
        enumerator culaSparseAPattern
        enumerator culaSparseA2Pattern
        enumerator culaSparseA3Pattern
        enumerator culaSparseA4Pattern
    end enum

    !
    ! General Options
    !

    ! culaSparseHandle
    type, bind(C) :: culaSparseHandle
        type(c_ptr) :: handle
    end type culaSparseHandle

    ! culaSparseConfig
    type, bind(C) :: culaSparseConfig
      real(c_double) :: relativeTolerance
      real(c_double) :: absoluteTolerance
      real(c_double) :: divergenceTolerance
      integer(c_int) :: maxIterations
      real(c_double) :: maxRuntime
      type(c_ptr) :: residualvector
      integer(c_int) :: useInitialResultVector
      integer(c_int) :: useBestAnswer
      integer(c_int) :: useStagnationCheck
    end type culaSparseConfig

    ! culaSparseResidualInfo
    type, bind(C) :: culaSparseResidualInfo
        real(c_double) :: r0
        real(c_double) :: relative
        real(c_double) :: absolute
        type(c_ptr) :: byIteration
    end type culaSparseResidualInfo 

    ! culaSparseTiming
    type, bind(C) :: culaSparseTiming
        real(c_double) :: solve
        real(c_double) :: preconditioner
        real(c_double) :: overhead
        real(c_double) :: total
    end type culaSparseTiming

    ! culaSparseResult
    type, bind(C) :: culaSparseResult
        type(culaSparseConfig) :: config
        integer(c_int) :: flag
        integer(c_int) :: iterations
        type(culaSparseResidualInfo) :: residual
        type(culaSparseTiming) :: timing
        integer(c_int) :: code
    end type culaSparseResult

    !
    ! Platform Options
    !

    ! culaSparseHostOptions 
    type, bind(C) :: culaSparseHostOptions
      integer(c_int) :: reordering
      integer(c_int) :: debug
    end type culaSparseHostOptions

    ! culaSparseCudaOptions 
    type, bind(C) :: culaSparseCudaOptions
      integer(c_int) :: reordering
      integer(c_int) :: deviceId
      integer(c_int) :: useHybridFormat
      integer(c_int) :: debug
    end type culaSparseCudaOptions

    ! culaSparseCudaDeviceOptions 
    type, bind(C) :: culaSparseCudaDeviceOptions      
      integer(c_int) :: deviceId
      integer(c_int) :: useHybridFormat 
      integer(c_int) :: debug
    end type culaSparseCudaDeviceOptions

    !
    ! Data Format Options
    !

    ! culaSparseCooOptions
    type, bind(C) :: culaSparseCooOptions
      integer(c_int) :: indexing
    end type culaSparseCooOptions

    ! culaSparseCsrOptions
    type, bind(C) :: culaSparseCsrOptions
      integer(c_int) :: indexing
    end type culaSparseCsrOptions

    ! culaSparseCscOptions
    type, bind(C) :: culaSparseCscOptions
      integer(c_int) :: indexing
    end type culaSparseCscOptions

    !
    ! Solver Options
    !

    ! culaSparseBicgOptions
    type, bind(C) :: culaSparseBicgOptions
        integer(c_int) :: avoidTranspose
    end type culaSparseBicgOptions

    ! culaSparseBicgstabOptions
    type, bind(C) :: culaSparseBicgstabOptions
        integer(c_int) :: reserved
    end type culaSparseBicgstabOptions

    ! culaSparseBicgstablOptions
    type, bind(C) :: culaSparseBicgstablOptions
        integer(c_int) :: l
    end type culaSparseBicgstablOptions

    ! culaSparseCgOptions
    type, bind(C) :: culaSparseCgOptions
        integer(c_int) :: reserved
    end type culaSparseCgOptions

    ! culaSparseGmresOptions
    type, bind(C) :: culaSparseGmresOptions
      integer(c_int) :: restart
    end type culaSparseGmresOptions
    
    ! culaSparseMinresOptions
    type, bind(C) :: culaSparseMinresOptions
      integer(c_int) :: reserved
    end type culaSparseMinresOptions

    !
    ! Preconditioner Options
    !

    ! culaSparseEmptyOptions
    type, bind(C) :: culaSparseEmptyOptions
      integer(c_int) :: unused
    end type culaSparseEmptyOptions

    ! culaSparseJacobiOptions
    type, bind(C) :: culaSparseJacobiOptions
      integer(c_int) :: reserved
    end type culaSparseJacobiOptions

    ! culaSparseBlockjacobiOptions
    type, bind(C) :: culaSparseBlockjacobiOptions
      integer(c_int) :: blockSize
    end type culaSparseBlockjacobiOptions

    ! culaSparseIlu0Options
    type, bind(C) :: culaSparseIlu0Options
      integer(c_int) :: reordering
    end type culaSparseIlu0Options

    ! culaSparseAinvOptions
    type, bind(C) :: culaSparseAinvOptions
      integer(c_int) :: pattern
      real(c_double) :: dropTolerance
    end type culaSparseAinvOptions

    ! culaSparseFainvOptions
    type, bind(C) :: culaSparseFainvOptions
      integer(c_int) :: pattern
      real(c_double) :: dropTolerance
    end type culaSparseFainvOptions

end module cula_sparse_type

