        use cula_sparse_type
        type(culaSparseHandle), intent(in), value :: handle
        type(culaSparseConfig), intent(in) :: config
        type(culaSparseHostOptions), intent(in) :: platformOpts
        type(culaSparseCooOptions), intent(in) :: formatOpts
        type(culaSparseBicgOptions), intent(in) :: solverOpts
        type(culaSparseEmptyOptions), intent(in) :: precondOpts
        integer(c_int), intent(in), value :: n
        integer(c_int), intent(in), value :: nnz
        real(c_float), intent(in), dimension(nnz) :: a
        integer(c_int), intent(in), dimension(nnz) :: rowInd
        integer(c_int), intent(in), dimension(nnz) :: colInd
        real(c_float), intent(out), dimension(n) :: x
        real(c_float), intent(in), dimension(n) :: b
        type(culaSparseResult), intent(out) :: result
    end function
end interface

